import "./App.css";

class App extends React.Component {
  render() {
    return (
      <div className={"App"}>
        <div className={"InputWrapper"}>
          <input placeholder={"Enter a value..."} />
          <button>Submit</button>
        </div>
      </div>
    );
  }
}

export default App;
